import React, { Component } from "react";
import { Slider, SafeAreaView, Picker, Text, StyleSheet, View, TextInput, Image, Button, ScrollView, ImageBackground } from "react-native";
import { FontAwesome ,AntDesign,Entypo,Feather} from '@expo/vector-icons';
import { MaterialCommunityIcons, EvilIcons,SimpleLineIcons } from '@expo/vector-icons';
import { TouchableOpacity } from "react-native-gesture-handler";
const image = { uri: "https://reactjs.org/logo-og.png" };

class Homes extends React.Component {
  color = new Array([{ backgroundColor: "rgba(192, 125, 2, 0.671)" }], "", "", "", "", "");


  constructor(props) {
    super(props)

    this.state = {
      Username: '',
      phone: '',
      Email: '',
      Password: '',
      configPassword: '',
      facility: "1",
      TypeOfProperty: "1",

    };

  }
  FunTypeOfProperty(LetTypeOfProperty) {

    this.setState({ TypeOfProperty: LetTypeOfProperty });
    for (let i = 0; i < this.color.length; i++) {
      this.color[i] = "";
      if (i == LetTypeOfProperty) {
        this.color[LetTypeOfProperty] = { backgroundColor: "rgba(192, 125, 2, 0.671)" };
      }

    }
  }
  render() {

    const width = 20;
    return (

      <ScrollView style={{ height: "100%",backgroundColor:"#ae1fcfa" }} >

        <View style={{ height: "100%",backgroundColor:"#ae1fcfa"  }}>
          <View style={styles.viewhead}>

            <View style={{
              width: '20.3%',
              height: "50%",

              borderColor: "#000",
              borderRadius: 100,


            }}>
              <Image style={styles.Img1}
                source={require('../../assets/Arbic.jpg')}
              />
            </View>
            <View style={{
              width: '30.3%',
              height: "100%",
              marginLeft: "35%",

            }}>

            </View>
            <View style={{
              width: '20.3%',
              height: "100%",
              borderColor: "#000",
              borderRadius: 100,


            }}>

              <FontAwesome name="dollar" size={24} color="blue" />
            </View>

          </View>

          <View style={styles.InputView}>
            <View style={styles.backgroundImage}>
              <View style={styles.IconBlock}>
                <MaterialCommunityIcons style={styles.Icon} name="keyboard-variant" size={24} color=" #c2c2a3" />
              </View>
              <TextInput style={styles.textInput} onChangeText={(text) => console.log(text)} placeholder={"Enter Key Term"} />
            </View>

            <View style={styles.backgroundImage}>
              <View style={styles.IconBlock}>
                <EvilIcons style={styles.Icon} name="location" size={24} color="black" />
              </View>
              <TextInput style={styles.textInput} onChangeText={(text) => console.log(text)} placeholder={"location"} />
            </View>
            <View style={styles.labelLest}>
              <Text style={{ marginLeft: "6%" ,marginTop:"2%"}}>Number home </Text>
              <Text style={{ marginLeft: "20%",marginTop:"2%" }}>Number home</Text>
            </View>
            <View style={styles.PickeView}>
              <View style={styles.PickeBlock}>

                <Picker
                  selectedValue={this.state.facility}
                  
                  onValueChange={itemValue => this.setState({
                    facility: itemValue
                    
                  })}
                >
                  <Picker.Item label="1 day type" value="Choosetype" />
                  <Picker.Item label="Apartment" value="Apartment" />
                  <Picker.Item label="Villa" value="Villa" />
                  <Picker.Item label="Compound" value="Compound" />
                  <Picker.Item label="Townhouse" value="Townhouse" />
                  <Picker.Item label="Duplex" value="Duplex" />
                  <Picker.Item label="Penthouse" value="Penthouse" />
                  <Picker.Item label="Triplex" value="Triplex" />
                </Picker>
              </View>

              <View style={styles.PickeBlock}>

                <Picker
                  selectedValue={this.state.facility}
                  onValueChange={itemValue => this.setState({
                    facility: itemValue
                  })}
                >
                  <Picker.Item label="2 day" value="1" />
                  <Picker.Item label="1 day" value="2" />
                  <Picker.Item label="1 day" value="3" />
                  <Picker.Item label="1 day" value="4" />
                  <Picker.Item label="1 day" value="5" />
                  <Picker.Item label="1 day" value="6" />
                  <Picker.Item label="Penthouse" value="7" />
                  <Picker.Item label="1 day" value="8" />
                </Picker>
              </View>
            </View>


            <View style={styles.colm2} >
              <View style={styles.row3}>
                <View style={styles.colm2} >
                  <TouchableOpacity style={[styles.checked, this.color[0]]} onPress={() => this.FunTypeOfProperty(0)}>
                    <MaterialCommunityIcons  style={styles.IconChecked} name="home" size={24} color="black" />
                  </TouchableOpacity>
                  <Text style={styles.TextChecked}>Number home </Text>
                </View>
                <View style={styles.colm2} >
                  <TouchableOpacity style={[styles.checked, this.color[1]]} onPress={() => this.FunTypeOfProperty(1)}>
                    <MaterialCommunityIcons  style={styles.IconChecked} name="home-city-outline" size={24} color="black" />
                  </TouchableOpacity>
                  <Text style={styles.TextChecked}>Number home </Text>
                </View>
                <View style={styles.colm2} >
                  <TouchableOpacity style={[styles.checked, this.color[2]]} onPress={() => this.FunTypeOfProperty(2)}>
                  <MaterialCommunityIcons style={styles.IconChecked}  name="city" size={24} color="black" />
                  </TouchableOpacity>
                  <Text style={styles.TextChecked}>Number home </Text>
                </View>

              </View>

            </View>


            <View style={styles.row3}>
              <View style={styles.colm2} >
                <TouchableOpacity style={[styles.checked, this.color[3]]} onPress={() => this.FunTypeOfProperty(3)}>
                  <MaterialCommunityIcons  style={styles.IconChecked} name="home-city-outline" size={24} color="black" />
                </TouchableOpacity>
                <Text style={styles.TextChecked}>Number home </Text>
              </View>
              <View style={styles.colm2} >
                <TouchableOpacity style={[styles.checked, this.color[4]]} onPress={() => this.FunTypeOfProperty(4)}>
                  <MaterialCommunityIcons style={styles.IconChecked} name="city-variant" size={24} color="black" />
                </TouchableOpacity>
                <Text style={styles.TextChecked}>Number home </Text>
              </View>
              <View style={styles.colm2} >
                <TouchableOpacity style={[styles.checked, this.color[5]]} onPress={() => this.FunTypeOfProperty(5)}>

                  <MaterialCommunityIcons style={styles.IconChecked} name="home-minus" size={24} color="black" />
                </TouchableOpacity >
                <Text style={styles.TextChecked}>Number home </Text>
              </View>



            </View>
            <TouchableOpacity style={styles.sarch}>
               

            <Text style={styles.TextSarch}>Sarch property </Text>
            <AntDesign style={styles.IconSarch} name="search1" size={24} color="black" />
            </TouchableOpacity>







            <View style={styles.footerRow}>
              <TouchableOpacity style={styles.footercolm}>
                <AntDesign  style={styles.Iconfooter}  name="setting" size={24} color="black" />
                <Text style={styles.TextChecked}>Sitting   </Text>

              </TouchableOpacity>
              <TouchableOpacity style={styles.footercolm}>
                <SimpleLineIcons style={styles.Iconfooter}  name="user" size={24} color="black" />
                <Text style={styles.TextChecked}>User  </Text>

              </TouchableOpacity>

              <TouchableOpacity style={styles.footercolm}>
              <Feather style={styles.Iconfooter} name="heart" size={24} color="black" />
              <Text style={styles.TextChecked}>Number  </Text>

              </TouchableOpacity>

              <TouchableOpacity style={styles.footercolm}>
              <AntDesign style={styles.Iconfooter}  name="search1" size={24} color="black" />
              <Text style={styles.TextChecked}>Number  </Text>

              </TouchableOpacity>

              <TouchableOpacity style={styles.footercolm}>
              <Feather  style={styles.Iconfooter} name="phone-forwarded" size={24} color="black" />
              <Text style={styles.TextChecked}>Number  </Text>

              </TouchableOpacity>


            </View>

          </View>

        </View>



      </ScrollView>
    );



  }
}


const styles = StyleSheet.create({

  viewhead: {

    flex: 1,
    flexDirection: 'row',
    justifyContent: "flex-start",
    alignItems: "flex-start",
    marginTop: 10,
    height: "100%",


  },
  Img1: {
    backgroundColor: '#95BCDD',
    paddingVertical: 15,
    marginTop: '5%',
