    alignSelf: 'center',
  },
  Img2: {
    width: '50%',
    height: "100%",
  },
  Img3: {
    width: '100%',
    height: 30
  },
  InputView: {

    marginTop: "7%",
    height: "100%",

  },
  backgroundImage: {

    height: "100%",
    borderWidth: 2,
    borderRadius: 12,
    height: 50,
    borderColor: "#000",
    margin: "1%",
    marginLeft: "4%",
    marginRight: "4%",

  },
  IconBlock: {


    marginTop: 10,
    marginLeft: 10,


  }, textInput: {

    marginTop: "-8%",
    marginLeft: "15%",
    width: "70%"


  },
  PickeView: {


    flexDirection: 'row',


     marginTop:"1%",
     marginBottom:"3%",
  },

  PickeBlock: {

    width: "40%",
    height: "100%",
    padding:"-2%",
    borderWidth: 2,
    borderRadius: 20,
    borderColor: "#000",
    marginLeft: "5%",
 


  },
  labelLest: {


    flexDirection: 'row',



  }
  , colm2: {
    flexDirection: 'column',

    justifyContent: "center",

  }, row3: {

    marginLeft: "10%",

    flexDirection: 'row',
    justifyContent: "center",

  }, checked: {

    borderWidth: 3,
    marginLeft: "10%",
    borderRadius: 10,
    justifyContent: "center",

    width: "40%",
    padding: "8%",
    paddingBottom: "10%",



  }, IconChecked: {


    justifyContent: "center",


  },
  TextChecked: {


    fontSize: 10,
    width: "50%",
    marginLeft: "10%",
    marginTop: "4%",

  },sarch:{
    marginTop:"11%",
    backgroundColor:"rgb(250, 143, 3)",
    flexDirection: 'row',
    padding:"5%",
    justifyContent: "center",

  },IconSarch :{

    color:"#fff"


  },TextSarch:{
    color:"#fff",
    fontSize:18,
   

  },footerRow:{
    borderTopWidth:2,
    marginTop:"0%",
    bottom:"0%",
    zIndex:3,
    flexDirection: 'row',
    margin:0,  

  },footercolm:{
    marginTop:"10%",
    margin:0,   
    flexDirection: 'column',
 
  },
    TextFooter: {


    fontSize: 2,



  },Iconfooter:{
    justifyContent: "center",
    alignItems:"center",
    marginLeft:"10%",
     
  }



});
export default Homes;
